const baseURL = 'http://localhost:3000'

import axios from "axios"
import { provide } from "vue"

export default {
    getProviders() {
        var provider = []
        axios
        .get(`${baseURL}/providers`)
        .then(data => {provider.push(data.data)})
        return provider
    }
}
